import React ,{useState}from "react";
import "./LoginSignup.css";
import imf from "../assets/logonp.JPG";
import { Link } from "react-router-dom";
import LoginLogin from './LoginLogin'
function LoginSignup() {
  const [isClicked, setIsClicked] = useState(false);

  const handleClick = () => {
    setIsClicked(true);
  };
  return (
    <div className="containe shadow ">
      <div className="row justify-content-end">
        <div className="col-md-6 d-flex flex-column form align-items-center text-white order-2 justify-content-center">
          <img className="imf" src={imf} alt="" />
        </div>

        <div className="col-md-6 p-4">
          <div className="header">
            <div className="text">Sign Up</div>
            <div className="underline"></div>
          </div>
          <div className="inputs">
            <div className="input">
              <i
                class="fa-solid fa-user"
                style={{ color: "rgb(114, 175, 244)" }}
              ></i>
              <input type="text" placeholder="Username" />
            </div>
            <div className="input">
              <i
                class="fa-solid fa-envelope"
                style={{ color: "rgb(114, 175, 244)" }}
              ></i>
              <input type="email" placeholder="email" />
            </div>
            <div className="input">
              <i
                class="fa-solid fa-lock"
                style={{ color: "rgb(114, 175, 244)" }}
              ></i>
              <input type="password" placeholder="password" />
            </div>
          </div>

          <div className="submit-container">
            <button type="submit" className="submit">
              Sign Up
            </button>
            <div>
              {isClicked ? (
                <LoginLogin />
              ) :<h1></h1>}
              
            </div>
            <button onClick={handleClick} type="submit" className="submit">
              LOGIN
            </button>
          </div>
        </div>
      </div>
    </div>
  );
}

export default LoginSignup;
